func gen3sumLargeCase() []int {
	n := 3000
	min := -100000
	max := 100000
	nums := make([]int, n)
	r := rand.New(rand.NewSource(0))
	for i := 0; i < n; i++ {
		nums[i] = r.Intn(max*2+1) + min
	}
	return nums
}

